import React, { useState } from "react";
import { emojis, users, commands, channels } from "../../data/data";
import { FaPen, FaCheck } from "react-icons/fa";
import Chart from "../charts/chart";
import {
  onMD,
  onML,
  onMM,
  onMU,
  handleTouchStart,
  handleTouchMove,
  handleTouchEnd,
} from "./events";
const Dashboard = () => {
  const [move, setMove] = useState([0, 0]);
  const [prefix, setPrefix] = useState("!");
  const [edit, setEdit] = useState(false);

  return (
    <div
      className="container-fluid pb-3"
      style={{ maxWidth: "1300px", minHeight: "100%" }}
    >
      <div className="row no-gutters justify-content-between">
        <div
          className="p-2 col-lg-4 col-md-8 col-sm-8 col-12"
          style={{ height: "300px" }}
        >
          <div className="pnl convex-1 row p-2 no-gutters justify-content-between newish">
            <div className="col-12 lead py-3 text-center">Channels</div>
            <div className="col-12 h-100 p-2">
              {channels.map((x, i) => {
                return (
                  <div className="row no-gutters justify-content-between">
                    <div className="col-6 lead h-24">{x.name}</div>
                    <div className="col-3">
                      <div className="row h-24 p-2">
                        <div
                          className="pnl concave-2 h-24"
                          style={{
                            justifyContent: "flex-start",
                          }}
                        >
                          <div
                            onMouseDown={(e) => onMD(e, 1)}
                            onMouseUp={(e) => onMU(e, 1, setMove)}
                            onMouseMove={(e) => onMM(e, 1, setMove)}
                            onMouseLeave={() => onML(setMove)}
                            onTouchStart={(e) => handleTouchStart(e, 1)}
                            onTouchMove={(e) => handleTouchMove(e, 1, setMove)}
                            onTouchEnd={(e) => handleTouchEnd(e, 1, setMove)}
                            className="pnl w-65 convex-2"
                            style={{
                              background: "rgb(165, 250, 251)",

                              transform: `translateX(${
                                move[0] === 1 ? move[1] : 0
                              }px)`,
                            }}
                          ></div>
                        </div>
                      </div>
                    </div>
                  </div>
                );
              })}
              {/* <div className="h-24 p-2 lead d-flex align-items-center">
                Voice
              </div>
              <div className="h-24 p-2 lead d-flex align-items-center">
                General
              </div>
              <div className="h-24 p-2 lead d-flex align-items-center">
                Music
              </div> */}
            </div>
            <div className="col-3 h-100 p-2">
              <div className="row h-24 p-2">
                <div
                  className="pnl concave-2"
                  style={{ justifyContent: "flex-end" }}
                >
                  <div
                    onMouseDown={(e) => onMD(e, 2)}
                    onMouseUp={(e) => onMU(e, 2, setMove)}
                    onMouseMove={(e) => onMM(e, 2, setMove)}
                    onMouseLeave={() => onML(setMove)}
                    onTouchStart={(e) => handleTouchStart(e, 2)}
                    onTouchMove={(e) => handleTouchMove(e, 2, setMove)}
                    onTouchEnd={(e) => handleTouchEnd(e, 2, setMove)}
                    className="pnl w-65 convex-2"
                    style={{
                      background: "rgb(165, 250, 251)",
                      transform: `translateX(${move[0] === 2 ? move[1] : 0}px)`,
                    }}
                  ></div>
                </div>
              </div>
              <div className="row h-24 p-2">
                <div
                  className="pnl concave-2"
                  style={{ justifyContent: "flex-start" }}
                >
                  <div
                    onMouseDown={(e) => onMD(e, 3)}
                    onMouseUp={(e) => onMU(e, 3, setMove)}
                    onMouseMove={(e) => onMM(e, 3, setMove)}
                    onMouseLeave={() => onML(setMove)}
                    onTouchStart={(e) => handleTouchStart(e, 3)}
                    onTouchMove={(e) => handleTouchMove(e, 3, setMove)}
                    onTouchEnd={(e) => handleTouchEnd(e, 3, setMove)}
                    className="pnl w-65 convex-2"
                    style={{
                      background: "rgb(165, 250, 251)",
                      transform: `translateX(${move[0] === 3 ? move[1] : 0}px)`,
                    }}
                  ></div>
                </div>
              </div>
            </div>
          </div>
        </div>

        <div
          className="col-lg-3 col-md-4 col-sm-4 col-8"
          style={{ height: "300px", maxWidth: "265px" }}
        >
          <div className="row no-gutters h-100 p-2">
            <div className="col-md-12 h-30 p-2">
              <div className="newish convex-1 pnl align-items-center justify-content-center lead">
                Prefix
